import axios from 'axios';

const newEnderecoController = async (
    rua: string,
    complemento: string,
    numero: string,
    bairro: string,
    cidade: string,
    estado: string,
    cep: string,
  ): Promise<boolean> => {
  try {
    const response = await axios.post('/Propietario/CreatePropietario', { rua, complemento, numero, bairro, cidade, estado, cep}, { timeout: 5000 });
    const createdProprietor = response?.data;

    // Handle the created proprietor as needed
    console.log('Endereco cadastrado com sucesso!', createdProprietor);

    return true;
  } catch (error) {
    // Handle errors
    console.error('Erro ao cadastrar endereco:', error);
    return false;
  }
};

export default newEnderecoController;
